import axios from 'axios';
import { useState } from 'react';

const InstructorSignup = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [section, setSection] = useState('');

  const handleSignup = async () => {
    const instructor = { name, email, password, section };
    await axios.post('http://localhost:8080/api/instructors/signup', instructor);
    alert('Instructor signed up successfully!');
  };

  return (
    <div>
      <h2>Instructor Signup</h2>
      <input type="text" placeholder="Name" onChange={(e) => setName(e.target.value)} />
      <input type="email" placeholder="Email" onChange={(e) => setEmail(e.target.value)} />
      <input type="password" placeholder="Password" onChange={(e) => setPassword(e.target.value)} />
      <input type="text" placeholder="Section" onChange={(e) => setSection(e.target.value)} />
      <button onClick={handleSignup}>Sign Up</button>
    </div>
  );
};

export default InstructorSignup;
